-- Pokemon/Move types
CREATE TABLE IF NOT EXISTS `item` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(32) NOT NULL,
  `description` varchar(128) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

CREATE TABLE IF NOT EXISTS `ability` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(32) NOT NULL,
  `description` varchar(128) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

CREATE TABLE IF NOT EXISTS `pokemon` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(32) NOT NULL,
  `type1` varchar(16),
  `type2` varchar(16),
  `hp` smallint unsigned NOT NULL,
  `attack` smallint unsigned NOT NULL,
  `defense` smallint unsigned NOT NULL,
  `sp_attack` smallint unsigned NOT NULL,
  `sp_defense` smallint unsigned NOT NULL,
  `speed` smallint unsigned NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

CREATE TABLE IF NOT EXISTS `pokemon_abilities` (
  `pokemon_id` int unsigned NOT NULL,
  `ability_id` int unsigned NOT NULL,
  `is_hidden` boolean NOT NULL,
  PRIMARY KEY (`pokemon_id`, `ability_id`),
  KEY `fk_pokemon_id_a` (`pokemon_id`),
  CONSTRAINT `fk_pokemon_id_a` FOREIGN KEY (`pokemon_id`) REFERENCES `pokemon` (`id`) ON UPDATE CASCADE ON DELETE NO ACTION,
  KEY `fk_ability_id` (`ability_id`),
  CONSTRAINT `fk_ability_id` FOREIGN KEY (`ability_id`) REFERENCES `ability` (`id`) ON UPDATE NO ACTION ON DELETE NO ACTION 
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

CREATE TABLE IF NOT EXISTS `move` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(32) NOT NULL,
  `type` varchar(16),
  `category` varchar(16),
  `power` tinyint unsigned NOT NULL,
  `accuracy` tinyint NOT NULL, -- negative accuracy means infinite accuracy
  `pp` tinyint unsigned NOT NULL,
  `description` varchar(128) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

CREATE TABLE IF NOT EXISTS `teachable_moves` (
  `pokemon_id` int unsigned NOT NULL,
  `move_id` int unsigned NOT NULL,
  PRIMARY KEY (`pokemon_id`, `move_id`),
  KEY `fk_pokemon_id_m` (`pokemon_id`),
  CONSTRAINT `fk_pokemon_id_m` FOREIGN KEY (`pokemon_id`) REFERENCES `pokemon` (`id`) ON UPDATE CASCADE ON DELETE NO ACTION,
  KEY `fk_move_id` (`move_id`),
  CONSTRAINT `fk_move_id` FOREIGN KEY (`move_id`) REFERENCES `move` (`id`) ON UPDATE CASCADE ON DELETE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

